const Frontpage = () => {
    return (
        <div>
            <p>
                Hello, I'm <strong>Branislav Šály</strong>, an unemployd man who is <br />
                searching for junior web development job in Bratislava.
            </p>
        </div>
    )
}

export default Frontpage
